          <p className="modal__description">
            Sentence that will tell the user what this modal is for or something.
          </p>
        </div>

        <p className="modal__text">
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Facilis ex dicta maiores
          libero minus obcaecati iste optio, eius labore repellendus.
        </p>

        <button className="modal__btn">Button &rarr;</button>

        <a href="#modal-closed" className="link-2"></a>
      </div>
    </div>
  );
}

export default ErrorModal;
